import React from "react";
import "./styles/landing.css"
import { motion } from "framer-motion";

const Section = ({id, title, content}) => {
    return (
        <section id={id}>
            <h2>{title}</h2>
            <p>{content}</p>
        </section>
    );
};

const Landing = () => {

    return (
        <div className="container">
            <Section id="home" title="Home" content="Home"/>
            <Section id="for-business" title="For Businesses" content="For Business"/>
            <Section id="pricing" title="Pricing" content="Pricing"/>
        </div>



    )
}

export default Landing;
